css:
.php-debug .php-debug-tab {
  flex: 1;
  overflow-y: scroll;
}
.php-debug li {
  list-style-type: none;
}
.php-debug ul {
  padding-left: 15px;
}
.php-debug .context-variable-list-view .type {
  padding-left: 1em;
}
.tabs-view {
  display: flex;
  height: 100%;
}
.tabs-view:nth-child(1) {
  order: 0;
}
.tabs-view:nth-child(2) {
  order: 1;
}
.tabs-view:nth-child(3) {
  order: 2;
}
.tabs-view:nth-child(3) {
  order: 3;
}
